import React from 'react';
import {BrowserRouter,Route} from 'react-router-dom';
import PlanCreate from './plans/PlanCreate';
import PlanDelete from './plans/PlanDelete';
import PlanShow from './plans/PlanShow';
import PlanList from './plans/PlanList';
import PlanEdit from './plans/PlanEdit';
import Header from './Header';
import history from ''
const  App = () => {
  return (
    <div className="ui container">
        <BrowserRouter>
            <div>
            <Header/>
            <Route path="/" exact component={PlanList}/>
            <Route path="/plan/new" exact component={PlanCreate}/>
            <Route path="/plan/edit" exact component={PlanEdit}/>
            <Route path="/plan/delete" exact component={PlanDelete}/>
            <Route path="/plan/show" exact component={PlanShow}/>
            </div>
        </BrowserRouter>
    </div>
  );
}

export default App;
